    return (
      <div className="App">
        <h1>Sale</h1>
        {this.props.nfts.map((nft, key) => {
          if (nft.purpose == 1) {
            return (
              <div class="nft">
                <p>Id: {nft.id}</p>
                <p>Title: {nft.title}</p>
                <p>{nft}</p>
                <p>{nft}</p>
              </div>
            );
          }
        })}
      </div>
    );
  }
}

export default Main;
